:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Emily Jane and GRAY, Charles
  02> WILLIAMS, Emily Jane m on 26.07.1882 to GRAY, Charles
  b 07.03.1856 d 27.06.1942
  b 22.10.1840 d 08.03.1918
  Emily b. at Whakato, Poverty Bay and d. at Gisborne. Charles, s/o Charles Gray (Rector
  of Godmanchester, England) and Agnes Norris (who was d/o John Norris of Hughenden
  Manor, Bucks. After the death of John Norris, Hughenden was sold to Benjamin Disraeli,
  Earl of Beaconsfield). Charles was b. in England and spent some years at sea earning
  his Master's Certificate. He was an officer in the English Merchant Service and took
  part in the running of the blockade to the Southern States during the American Civil
  War. He later joined his brother, Robert, and cousin, Ernest Henry, in pioneering the Hughenden district (named
  after the old family home) in Queensland. He previously married in 1863 to Lucy Sarah Waters who died in 1879.
  Lucy was a talented artist and her account of her arrival at Hughenden is preserved in the Queensland State
  Archives. The climate at Hughenden did not suit his wife's health so he sold out to Robert and moved to New
  Zealand where he purchased "Waiohika" station in 1877. He was very active in local affairs and was a
  foundation member of the Gisborne Club. Grays Bush and Grays Hill in the Gisborne district are both named
  after him.
  Waiohika
  Waiohika, six miles out of Gisborne City, was purchased by Charles Gray in 1877. It comprises 2,008 acres and
  is situated on the northern side of the Poverty Bay flats, off the Waimana Valley Road. About one tenth of the
  land is flat and the rest is hill country. After Charles' death, "Waiohika" was managed by his son Camplin and
  others. The station was auctioned on 14.11.1980 and bought by Mangatu Blocks. It finally passed out of Gray
  ownership on 31.03.1981.
  In the 1920s, Emily employed architect J A Louis Hay (who happened to be her son Camplin's brother-in-law) to
  design a house which was built on a rise overlooking the flats. Louis Hay was strongly influenced by the
  American architect, Frank Lloyd Wright, and the house he designed was reminiscent of Wrights "Prairie Houses"
  (see "New Zealand Architecture" by Peter Shaw, pp 96-97). The former house was demolished and some of the
  materials were used in the construction of the new homestead. The door from the old house can still be seen in
  what was the men's quarters.
  Some time after Emily's death this house and several acres surrounding it were cut off from the rest of the
  property and sold. It is now owned by Mr and Mrs D Witters and has become something of a showpiece.
  "Waihora", 43 km from Gisborne in the Waihora Valley, was also owned by the Gray family. It was sold at the
  same time as "Waiohika".
  01> GRAY, Robert Leonard m on ** **, 1902 to LANGFORD, Margaret
  b 11.10.1883 d 28.06.1961
  b 17.08.1881 d ** ** 1957
  Leonard b. at Waiohika. He studied Electrical Engineering in Vancouver, British Columbia, and then at the
  Armour Institute of Technology in Chicago, graduating BSc. He worked for a year in Sydney, Australia,
  where the family lived at Fivedock. He then returned to New Zealand and worked on the reticulation of
  power from Lake Coleridge. Later he became Chief Electrical Engineer with the Tararua Electric Power Board
  with responsibility for the electrification of the district. He then became a consultant in Wellington and
  formed Technical Publications, editing the New Zealand Electrical Journal. He later lived for some time in
  Napier and finally retired to Gisborne where he lived in Russell Street and served for some time on the
  Power Board.
  Margaret had a lovely voice and was quite well known as a singer. In later years she became a champion
  bridge and croquet player.
  01> GRAY, Amy Mary m on 21.09.1927 to WATSON, Robert Wallis
  b 29.08.1903
  b 09.03.1903 d 04.10.1954
  Amy b, at Vancouver, Canada, and m. at Gisborne. Robert, slo Archibald Robert
  Watson and Ella Mary Wallis. Address: Te Wiremu House, 621 Aberdeen Road,
  Gisborne.
  Amy was educated at St Margaret's, Christchurch, and Chilton House,
  Wellington. For almost the whole of her married she lived on "Linburn"
  Station, where Robert was farming. They moved to Wainui Beach a year before
  his death. Amy continued to live at Wainui, and later at Whitaker Street, Gisborne. During this time
  she became an active member of the Canoe and Tramping Club and the Forest and Bird Protection Society.
  (cont...)
